import React from 'react'
import {Link} from "react-router-dom"
import Logo from './images/Logo.png'

const Header = () => {
  return (
    <div className='container nav_container'>
      <Link to="/" className='nav_logo'>
        <img src="" alt="" />
      </Link>

    </div>
  )
}

export default Header
